import React, { Component } from "react";
import { View, Text, Button, TouchableOpacity, StyleSheet } from "react-native";

export default class AnimalView extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <View style={{ flex: 1 }}>
        <View style={{ backgroundColor: "yellow", flex: 1 }}></View>
        <View
          style={{ backgroundColor: "pink", flex: 4, flexDirection: "row" }}
        >
          <View
            style={{
              backgroundColor: "red",
              flex: 4,
              justifyContent: "center",
              alignItems: "center",
            }}
          >
            <Text
              style={{
                fontWeight: "bold",
                fontSize: 18,
                color: "#ffffff",
              }}
            >
              aaaaaaaaaaaaaa
            </Text>
          </View>
          <View style={{ backgroundColor: "green", flex: 1 }}>
            <View style={{ flex: 1, backgroundColor: "brown" }}>
              <Text>Gnanod</Text>
            </View>
            <View style={{ flex: 1, backgroundColor: "orange" }}></View>
          </View>
          <View style={{ backgroundColor: "blue", flex: 2 }}>
            <Text>Divyani</Text>
          </View>
        </View>
        <View
          style={{
            flex: 1,
            //  backgroundColor: "pink",
          }}
        >
          <Button
            title="Learn More"
            color="#841584"
            onPress={() => {
              alert("clicked");
            }}
          />

          <TouchableOpacity
            onPress={() => {
              alert("clicked");
            }}
          >
            <View
              style={{
                ...styles.button,
                backgroundColor: "#0E6655",
                borderWidth: 1,
                borderColor: "white",
                opacity: this.buttonOpacity,
              }}
            >
              <Text
                style={{
                  fontSize: 18,
                  fontWeight: "bold",
                  color: "white",
                }}
              >
                Add Animal
              </Text>
            </View>
          </TouchableOpacity>
        </View>
      </View>
    );
  }
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    alignItems: "center",
    justifyContent: "center",
  },
  button: {
    backgroundColor: "white",
    height: 70,
    marginHorizontal: 20,
    borderRadius: 35,
    alignItems: "center",
    justifyContent: "center",
    marginVertical: 5,
    shadowColor: "#000",
    shadowOffset: {
      width: 0,
      height: 7,
    },
    shadowOpacity: 0.41,
    shadowRadius: 9.11,

    elevation: 14,
  },
});
